import React from 'react';
import image1 from '../src/bungalow.jpg';
import importScript from 'customHooks/importScript';
const Demo = props => {
  importScript("/path/to/resource.js");
}
import './App.css';
import Appheader from './Components/header';
function App() {
  return (
    <div className="App">
      <header className="App-header">
        <Appheader/>
      </header>
      <main>
        <div className='banner-wrp'>
            <div className='banner-slider'>
              <div className='image'>
                <img src={image1}></img>
              </div>
              <div className='image'>
                <img src=''></img>
              </div>
              <div className='image'>
                <img src=''></img>
              </div>
            </div>
        </div>
      </main>
    </div>
  );
}

export default App;
